function emoji_filter(text) {
    var item = emoji[text];
    if (!item)
        return text;
    template[1] = item.sheet_x * size;
    template[3] = item.sheet_y * size;
    return template.join('');
}
emoji_filter.regex = /:[^\s\{\}:]{1,20}:(?!```)/g;

function initialize() {
    var controls = $ENV.controls;
    control_folder = $DOC.root + 'components/controls/emoji/';
    
    function GEmoji(parameters, attributes) {
        this.initialize('emoji', parameters, attributes, $ENV.default_inline_template);
        
        size = parseInt(this.parameter('size')), tsize = '' + size;
        if (size !== 16 && size !== 20 && size !== 32 && size !== 64) {
            size = 20;
            tsize = '20';
        }
        
        type = this.parameter('type');
        if (type !== 'png' && type !== 'jpg')
            type = 'jpg';
        
        template =
        ['<div style="display:inline-block; width:' + tsize + 'px; height:' + tsize
            + 'px; background: url(\'' + control_folder + 'sheet_' + tsize + '.' + type + '\') no-repeat -',
        777,
        'px -',
        777,
        'px;"></div>'];
        
        var filters = $DOC.filters;
        filters.push(emoji_filter);
        $DOC.processContent(this, this.text());
        this.text('');
        var index = filters.indexOf(emoji_filter);
        if (index >= 0)
            filters.splice(index);
    };
    GEmoji.prototype = controls.control_prototype;
    controls.typeRegister('emoji', GEmoji);
}

